description:
Clear Acrylic A4 Tray and Pen Holder Set - Convenient to organize your files, documents, bills, receipts, letters, memos and pens, keep your files organized and your desk neat and tidy;
STACKABLE DESIGN - The bottom bar design makes it easy to stack this modern paper tray, you can buy as many as you need for stacking use to make room for your desk; the hollow handle on the side is easy to lift;
RELIABLE QUALITY - All are made of 5mm thick and hardened A-grade high-transparency acrylic, and the bottom has an ingenious horizontal bar with dual functions, which can be used as a leg for stable support, and can also be used as a connecting structure for more stable layer stacking;
SUITABLE SIZE - The tray size is 12.4 x 8.8 x 2.7 inches, suitable for A4 letter size documents, etc.; the pen holder size is 7.1 x 2.8 x 3.3 inches, can hold up to 6-10 pens or so;
WHAT YOU WILL GET - Comes with 2 clear acrylic stackable paper trays and 1 clear acrylic pen holder, high transparency for good visibility and decoration;
